import React from 'react';
import './AromatherapySection.css';

const CustomizableShellSection: React.FC = () => {
  return (
    <section className="aromatherapy-section">
      <div className="aromatherapy-image">
        <div className="image-frame">
          <img src={process.env.PUBLIC_URL + '/custom-shell.png'} alt="Customizable Shell Demonstration" />
        </div>
      </div>
      <div className="aromatherapy-content">
        <h2 className='AROMATHERAPY-title'>AROMATHERAPY</h2>
        <p>Elevate your resting experience with our selection of soothing scents. Designed to complement your relaxation, aromatherapy helps reduce stress and promotes a sense of well-being.</p>
        <ul>
          <li>Variety of calming scents like lavender and eucalyptus</li>
          <li>Aromatherapy integrated with the pod for seamless diffusion</li>
          <li>Scents tailored to improve mood and relaxation</li>
          <li>Option to switch between different scents based on your preference</li>
        </ul>
      </div>
    </section>
  );
};

export default CustomizableShellSection;
